// #######################################
// AST还原流程
// #######################################
// 需要解码的文件位置
let encode_file = 'gcaptcha4.js';
// 解码后的文件位置
let decode_file = 'gcaptcha4_decode.js';

// 读取需要解码的js文件, 注意文件编码为utf-8格式
let jscode = fs.readFileSync(encode_file, { encoding: 'utf-8' });

// 将js代码修转成AST语法树
let ast = parser.parse(jscode);
// AST结构修改逻辑
const visitor = {
  StringLiteral: {
    enter: [replace_unicode],
  },
  VariableDeclaration: {
    enter: [get_name_array],
  },
  CallExpression: {
    enter: [replace_name_array, replace_$_CU],
  },
  ForStatement: {
    enter: [replace_ForStatement],
  },
  ExpressionStatement: {
    enter: [delete_func],
  },
};

// 遍历语法树节点，调用修改函数
traverse(ast, visitor);

// 将ast转成js代码，{jsescOption: {"minimal": true}} unicode -> 中文
let { code } = generator(ast, (opts = { jsescOption: { minimal: true } }));
// 将js代码保存到文件
fs.writeFile(decode_file, code, (err) => {});
